import React from "react";

const Contact = () => {
  return (
    <section className="contact" id="contact">
      {" "}
      <h2 className="section_title">Contact</h2>
      <span className="section_subtitle">Get In Touch With Me!</span>
      <div className="contact__container contact grid">
        <div className="contact_content">
          <h3 className="contact_title">Talk to me</h3>

          <div className="contact_info">
            <div className="contact_card">
              <i className="bx bx contact_card-icon"></i>
              <h3 className="contact_card-title"></h3>
              <span className="contact_card-data"></span>

              <a href="#" className="contact_button">
                Write Me{""}
                <i className="bx bx-right-arrow-alt contact_botton-icon"></i>
              </a>
            </div>
          </div>
        </div>

        <div className="contact_content">
          <h3 className="contact_title">
            Write me{" "}
            <i className="bx bx-right-arrow-alt contact_button-icon"></i>
          </h3>
        </div>

        <div className="contact_content">
          <h3 className="contact_title">Talk to me</h3>
        </div>
      </div>
    </section>
  );
};

export default Contact;
